import React from 'react'

export const Card =(listOfInfo)=>{
    return (
        <div>
            {listOfInfo.map(info=>{
                return (
                    <ul>
                        <li>
                            {info.title}
                        </li>
                    </ul>
                )

            })}
        </div>
    )
}
